import React, { useState,useEffect } from 'react'
import Gallery from 'react-photo-gallery'


const Fetch = url => new Promise(resolve => {
  setTimeout(() => resolve([
    'https://images89.fotosik.pl/533/84e713a2c5ea7589.jpg',
    'https://images92.fotosik.pl/534/2330bbb7ae3fc6a0.jpg',
    'https://images89.fotosik.pl/533/7a299dde7a1ebdc7.jpg'
  ]), 2000)
})

const onClick = event => {
  alert(event.target.src)
}

const PhotoGallery1 = () => {
  const [photos, setPhotos] = useState([])

  useEffect(() => {
    Fetch(`/photos`)
      .then(urls => urls.map(url => ({src: url, width: 150, height: 150})))
      .then(setPhotos)
  }, [])

  return (
    <Gallery
      photos={photos}
      onClick={onClick}
    />
  )
}

export default PhotoGallery1
